import React, {Fragment} from 'react'

import Link from "next/link";


//Routes
import Home from './home'
import About from './about'

//Components
import Layout from '../components/layout'

import '../style.scss'

const Index = () => {
    return (
      <Layout>
          <Link href="/"><Home/></Link>
          <Link href="/about"><a>about</a></Link>
      </Layout>
    )
}

export default Index
